public class GradientMiniTrends : MonoBehaviour
{ //This is the "set" of all possible status effects
    public enum VariableName
    {
        SWE,
        delta_Q,
        melt,
        cummulativeSWI
    }

    //Now we can make a variable using that set as its type!
    public VariableName varName;

    public float vmin = 0f;
    public float vmax = 0.2f;
    public float range = 4f;
    public float xvel = -0.5f;
    public float life0 = 28f;

    private string valueFormat = "0.000";

    public Text eastText;
    public Text westText;
    public Text northText;
    public Text southText;

    private ParticleSystem.Particle[] points;

    Dictionary<int, float[]> data;

    float[] null_data = new float[] { 0f, 0f, 0f, 0f, 0f };

    Color[] colors = new Color[] 
    {
        new Color(241f/255f,  44f/255f,  100f/255f, 0.8f),  // east
        new Color( 71f/255f,  198f/255f, 244f/255f, 0.8f), // west
        new Color(254f/255f,  205f/255f,  70f/255f, 0.8f), // north
        new Color( 91f/255f,  201f/255f,  70f/255f, 0.8f), // south
        new Color(159f/255f,  159f/255f, 159f/255f, 0.8f), // flat
    };

    private GameObject slider;
    private SliderUpdate sliderUpdateScript;

    private int laststep = -1;
    private bool lastisplaying = true;
    private Vector3 origin;

    private Vector3 curpos;
    private Vector3 velocity;

    // Use this for initialization
    void Start()
    {
        slider = GameObject.FindWithTag("TimeSlider");
        sliderUpdateScript = (SliderUpdate)slider.GetComponent<SliderUpdate>();

        if (varName == VariableName.SWE)
        {
            load_grad_SWE();
            valueFormat = "0.000";
        }
        else if (varName == VariableName.delta_Q)
        { 
            load_grad_delta_Q();
            valueFormat = "0.0";
        }
        else if (varName == VariableName.melt)
        {
            load_grad_melt();
            valueFormat = "0.00";
        }
        else
        {
            load_cummSWI();
            valueFormat = "0.0";
        }

        origin = GetComponent<ParticleSystem>().transform.position;
        curpos = origin;
        velocity = new Vector3(xvel, 0f, 0f);
    }

    // Update is called once per frame
    void Update()
    {
        int step = (int)sliderUpdateScript.SimStepProperty;

        if (step != laststep)
        {
            float[] ewnsf; // east, west, north, south, flat
            try
            { 
                if (data.ContainsKey(step))
                    ewnsf = data[step];
                else
                    ewnsf = null_data;
            }
            catch
            {
                ewnsf = null_data;
            }

            if (laststep > 0) // emit particles
            {
                for (int i = 0; i < null_data.Length;  i++ )
                {
                    float value = ewnsf[i];

                    if (varName == VariableName.delta_Q)
                    {
                        // log transform
                        if (value > 0f)
                            value = Mathf.Log10(value + 1f);
                        else
                            value = Mathf.Log10(-1f * value + 1f);
                    }

                    curpos = new Vector3(origin.x,
                                         origin.y + range * (value - vmin) / (vmax - vmin),
                                         origin.z);

                    GetComponent<ParticleSystem>().Emit(curpos, velocity, 0.3f, life0, colors[i]);


                }

                eastText.text = ewnsf[0].ToString(valueFormat);
                westText.text = ewnsf[1].ToString(valueFormat);
                northText.text = ewnsf[2].ToString(valueFormat);
                southText.text = ewnsf[3].ToString(valueFormat);
            }
        }

        laststep = step;

        // was paused now playing
        if (sliderUpdateScript.IsPlayingProperty & !lastisplaying)
        {
            GetComponent<ParticleSystem>().Play();
        }
        // was playing now paused
        else if (!sliderUpdateScript.IsPlayingProperty & lastisplaying)
        {
            GetComponent<ParticleSystem>().Pause();
        }
        lastisplaying = sliderUpdateScript.IsPlayingProperty;
    }

